Adding these three polynomials results in $(-3x^2 + x - 4) + (-5x^2 + 3x - 8) + (5x^2 + 5x + 1)$. Simplifying this expression gives \begin{align*}
&(-3x^2 + -5x^2 + 5x^2) + (x + 3x + 5x) + (-4 - 8 + 1)\\
&= -3x^2 + x - 4 - 5x^2 + 3x - 8 + 5x^2 + 5x + 1\\
&= \boxed{-3x^2 + 9x - 11}.
\end{align*}
